I love this show! (^_^) I just think that it is funny as hell! (^_^)

Archer is quite possibly the funniest show on television, rapid fire jokes about whore island, a hungry hungry hippo, and baby crazy ex girlfriends, all that plus the brilliance of stir Friday. I am a total TV alchoholic and this show is incredibly funny. Though there is a slight issue with the comedy, if you take yourself too seriously and or you can't laugh at sheer stupidity the show might not be for you. Anyways you won't know if you like the comedy or not without watching an episode yourself. So I strongly incourage everyone to sit down watch an episode or two and I bet you will be rolling on the floor due to the doucheness that is Sterling Archer. Alright Andy I know the fact that arrested development got canceled still hurts but it doesn't mean you should start bashing a different kind of comedy. Archer is incredibly funny, and yes it is basic raunchy humor, but it is the sheer ridiculousness of each situation that allows the comedy to turn in literal loll. so open your mind laugh at a Russian roulette joke and enjoy the brilliant stupidity that is Archer. 

It comes on FX.

Show Nfo - At ISIS, an international spy agency, global crises are merely opportunities for its highly trained employees to confuse, undermine, betray and royally screw each other. At the center of it all is suave master spy Sterling Archer, whose less-than-masculine code name is &quot;Duchess.&quot; Archer works with his domineering mother Malory, who also is his boss. He also has to deal with his ex-girlfriend, Agent Lana Kane and her new boyfriend, ISIS comptroller Cyril Figgis, as well as Malory's lovesick secretary, Cheryl. 

